Function arraytoStringBind(&arStr As array of string) Returns string
   For &x = 1 To &arStr.Len
      If &x = 1 Then
         &strInBind = "'" | &arStr [&x] | "'";
      Else
         &strInBind = &strInBind | ",'" | &arStr [&x] | "'";
      End-If;
   End-For;
   Return &strInBind;
End-Function;


Function pushArrayParallel(&sCurrParent As string, &arTempRowSet As array of Rowset) Returns Rowset
   Local Rowset &rsABC;
   Evaluate &arTempRowSet.Len
   When 1
      &rsABC = CreateRowset(@("Record." | &sCurrParent), &arTempRowSet [1]);
      Break;
   When 2
      &rsABC = CreateRowset(@("Record." | &sCurrParent), &arTempRowSet [1], &arTempRowSet [2]);
      Break;
   When 3
      &rsABC = CreateRowset(@("Record." | &sCurrParent), &arTempRowSet [1], &arTempRowSet [2], &arTempRowSet [3]);
      Break;
   When 4
      &rsABC = CreateRowset(@("Record." | &sCurrParent), &arTempRowSet [1], &arTempRowSet [2], &arTempRowSet [3], &arTempRowSet [4]);
      Break;
   When 5
      &rsABC = CreateRowset(@("Record." | &sCurrParent), &arTempRowSet [1], &arTempRowSet [2], &arTempRowSet [3], &arTempRowSet [4], &arTempRowSet [5]);
      Break;
   When 6
      &rsABC = CreateRowset(@("Record." | &sCurrParent), &arTempRowSet [1], &arTempRowSet [2], &arTempRowSet [3], &arTempRowSet [4], &arTempRowSet [5], &arTempRowSet [6]);
      Break;
   When 7
      &rsABC = CreateRowset(@("Record." | &sCurrParent), &arTempRowSet [1], &arTempRowSet [2], &arTempRowSet [3], &arTempRowSet [4], &arTempRowSet [5], &arTempRowSet [6], &arTempRowSet [7]);
      Break;
   When 8
      &rsABC = CreateRowset(@("Record." | &sCurrParent), &arTempRowSet [1], &arTempRowSet [2], &arTempRowSet [3], &arTempRowSet [4], &arTempRowSet [5], &arTempRowSet [6], &arTempRowSet [7], &arTempRowSet [8]);
      Break;
   When 9
      &rsABC = CreateRowset(@("Record." | &sCurrParent), &arTempRowSet [1], &arTempRowSet [2], &arTempRowSet [3], &arTempRowSet [4], &arTempRowSet [5], &arTempRowSet [6], &arTempRowSet [7], &arTempRowSet [8], &arTempRowSet [9]);
      Break;
   When 10
      &rsABC = CreateRowset(@("Record." | &sCurrParent), &arTempRowSet [1], &arTempRowSet [2], &arTempRowSet [3], &arTempRowSet [4], &arTempRowSet [5], &arTempRowSet [6], &arTempRowSet [7], &arTempRowSet [8], &arTempRowSet [9], &arTempRowSet [10]);
      Break;
   When-Other
      Error "More then 10 Childs present, logic is not implemented yet.";
      Break;
   End-Evaluate;

   Return &rsABC;
End-Function;

Function CreateRowset4FileLayout(&sFLDName As string) Returns Rowset
   Local array of Rowset &arRowSet, &arTempRowSet;
   Local array of string &arParents;
   Local array of string &arListChilds;
   Local Rowset &rsDummy;

   &arRowSet = CreateArrayRept(&rsDummy, 0);
   &arTempRowSet = CreateArrayRept(&rsDummy, 0);
   &arParents = CreateArrayRept("", 0);
   &arListChilds = CreateArrayRept("", 0);

   Local SQL &sqlAllChilds = CreateSQL("SELECT FLDSEGNAME, FLDSEGPARENT FROM PSFLDSEGDEFN WHERE FLDDEFNNAME = :1 AND FLDSEGCOUNT = 0", &sFLDDefnName);
   While &sqlAllChilds.Fetch(&strSegName, &strSefParent)
      &arListChilds.Push(&strSegName);
      &arParents.Push(&strSefParent);
      &arRowSet.Push(CreateRowset(@("Record." | &strSegName)));
   End-While;

   Local string &strInBind2 = arraytoStringBind(&arListChilds);

   For &JJ = 1 To 5
      Local SQL &sqlNextLevel = CreateSQL("SELECT FLDSEGNAME, FLDSEGPARENT FROM PSFLDSEGDEFN A WHERE A.FLDDEFNNAME = :1 AND FLDSEGCOUNT <> 0  AND FLDSEGCOUNT = (SELECT COUNT(*) FROM PSFLDSEGDEFN B WHERE B.FLDDEFNNAME = A.FLDDEFNNAME AND B.FLDSEGPARENT = A.FLDSEGNAME AND B.FLDSEGNAME IN (" | &strInBind2 | "))", &sFLDDefnName);
      While &sqlNextLevel.Fetch(&strSegName, &strSefParent)
         &nParentAt = 0;
         If &strSefParent <> " " Then
            &nParentAt = &arParents.Find(&strSegName);
            While &nParentAt <> 0
               &arTempRowSet.Push(&arRowSet [&nParentAt]);

               &arRowSet [&nParentAt] = &rsDummy;
               &arParents [&nParentAt] = "";
               &arListChilds [&nParentAt] = "";

               &nParentAt = &arParents.Find(&strSegName);
            End-While;
            &arRowSet.Push(pushArrayParallel(&strSegName, &arTempRowSet));
            &arParents.Push(&strSefParent);
            &arListChilds.Push(&strSegName);
         Else
            For &KK = 1 To &arRowSet.Len
               &nParentAt = &arParents.Find(&strSegName);
               While &nParentAt <> 0
                  &arTempRowSet.Push(&arRowSet [&nParentAt]);

                  &arRowSet [&nParentAt] = &rsDummy;
                  &arParents [&nParentAt] = "";
                  &arListChilds [&nParentAt] = "";

                  &nParentAt = &arParents.Find(&strSegName);
               End-While;
               &arRowSet.Push(pushArrayParallel(&strSegName, &arTempRowSet));
               REM &arParents.Push(&strSefParent);
               &arListChilds.Push(&strSegName);
            End-For;
         End-If;
         &arTempRowSet = CreateArrayRept(&rsDummy, 0);
      End-While;
      &strInBind2 = arraytoStringBind(&arListChilds);
   End-For;

   Return &arRowSet [&arRowSet.Len];
End-Function;

Function AddEverySegment(&sFLDDefnName As string, &rsFinal As Rowset, &sSegName As string, &nSegCount As integer) Returns Rowset;
   For &i = 1 To &nSegCount
      SQLExec("SELECT FLDSEGNAME, FLDSEGCOUNT FROM PSFLDSEGDEFN WHERE FLDDEFNNAME = :1 AND FLDSEGPARENT = :2 AND FLDSEQNO = :3", &sFLDDefnName, &sSegName, &i, &sChildSegName, &nChildSegCount);
      If &nChildSegCount <> 0 Then
         REM MessageBox(0, "", 0, 0, "Inside AddEverySegment If Part " | &i | "-" | &sChildSegName);
         Return CreateRowset(&rsFinal, AddEverySegment(&sFLDDefnName, CreateRowset(@("Record." | &sChildSegName)), &sChildSegName, &nChildSegCount));
      Else
         REM MessageBox(0, "", 0, 0, "Inside AddEverySegment Else Part " | &i | "-" | &sChildSegName);
         Return CreateRowset(&rsFinal, CreateRowset(@("Record." | &sChildSegName)));
      End-If;
   End-For;

   Return &rsFinal;
End-Function;

