Function AddEverySegment(&sFLDDefnName As string, &rsFinal As Rowset, &sSegName As string, &nSegCount As integer) Returns Rowset;
   For &i = 1 To &nSegCount
      SQLExec("SELECT FLDSEGNAME, FLDSEGCOUNT FROM PSFLDSEGDEFN WHERE FLDDEFNNAME = :1 AND FLDSEGPARENT = :2 AND FLDSEQNO = :3", &sFLDDefnName, &sSegName, &i, &sChildSegName, &nChildSegCount);
      If &nChildSegCount <> 0 Then
         MessageBox(0, "", 0, 0, "Inside AddEverySegment If Part " | &i | "-" | &sChildSegName);
         Return CreateRowset(&rsFinal, AddEverySegment(&sFLDDefnName, CreateRowset(@("Record." | &sChildSegName)), &sChildSegName, &nChildSegCount));
      Else
         MessageBox(0, "", 0, 0, "Inside AddEverySegment Else Part " | &i | "-" | &sChildSegName);
         Return CreateRowset(&rsFinal, CreateRowset(@("Record." | &sChildSegName)));
      End-If;
   End-For;

   Return &rsFinal;
End-Function;

Function AddEverySegmentString(&sFLDDefnName As string, &rsFinal As string, &sSegName As string, &nSegCount As integer) Returns string;
   For &i = 1 To &nSegCount
      SQLExec("SELECT FLDSEGNAME, FLDSEGCOUNT FROM PSFLDSEGDEFN WHERE FLDDEFNNAME = :1 AND FLDSEGPARENT = :2 AND FLDSEQNO = :3", &sFLDDefnName, &sSegName, &i, &sChildSegName, &nChildSegCount);
      If &nChildSegCount <> 0 Then
         MessageBox(0, "", 0, 0, "Inside AddEverySegment If Part " | &i | "-" | &sChildSegName);
         rem &rsFinal = CreateRowset(@("Record." | &sSegName), AddEverySegment(&sFLDDefnName, CreateRowset(@("Record." | &sChildSegName)), &sChildSegName, &nChildSegCount));
         Return &rsFinal | ", " | AddEverySegmentString(&sFLDDefnName, "CR(" | &sChildSegName, &sChildSegName, &nChildSegCount) | ")";
      Else
         MessageBox(0, "", 0, 0, "Inside AddEverySegment Else Part " | &i | "-" | &sChildSegName);
         Return &rsFinal | ", CR(" | &sChildSegName | ")";
      End-If;
   End-For;

   Return &rsFinal | ")";
End-Function;

Function displayrowset(&rTemp As Row)
   For &x = 1 To &rTemp.RecordCount
      Local Record &rec;
      &rec = &rTemp.GetRecord(&x);
      For &fld = 1 To &rec.FieldCount
         MessageBox(0, "", 0, 0, "Rec.Field = Value => " | &rec.Name | "." | &rec.GetField(&fld).Name | " = " | &rec.GetField(&fld).Value);
      End-For;
   End-For;
End-Function;

