Function getFieldFormatText(&nTyp As integer, &nFmt As integer) Returns string;
   Local string &sFmtString;
   Evaluate &nFmt
   When 0
      If &nTyp = 0 Then
         &sFmtString = "UpperCase";
      Else
         &sFmtString = "HH:MM";
      End-If;
      Break;
   When 1
      &sFmtString = "Name";
      Break;
   When 2
      &sFmtString = "NA Phone 12 Chars";
      Break;
   When 3
      &sFmtString = "NA Zip/Postal 10 Chars";
      Break;
   When 4
      &sFmtString = "USA SSN 9 Chars";
      Break;
   When 5
      &sFmtString = "NA";
      Break;
   When 6
      &sFmtString = "Mixed Case";
      Break;
   When 7
      &sFmtString = "Raw/Binary";
      Break;
   When 8
      &sFmtString = "Numbers only";
      Break;
   When 9
      &sFmtString = "SIN 9 Chars";
      Break;
   When 10
      &sFmtString = "Int. Ph. Number";
      Break;
   When 11
      &sFmtString = "Int. Zip/Postal";
      Break;
   When 12
      &sFmtString = "HH:MM:SS";
      Break;
   When 13
      &sFmtString = "HH:MM:SS.999999";
      Break;
   When-Other
      &sFmtString = "Custom Format";
      Break;
   End-Evaluate;

   Return &sFmtString;
End-Function;

Function PopulateTemplateDetails(&ssObj As any, &nR As integer, &nC As integer, &sFldLabel As string, &nFldType As integer, &nFldLenth As integer, &FldDefault As any, &sFldNotes As string, &sFldDF As string, &sFldDtSep As string, &nFldFmt As integer)
   &ssObj.SetCellString(&nR, &nC, &sFldLabel);
   &ssObj.SetCellString(&nR + 3, &nC, &nFldLenth);
   &ssObj.SetCellString(&nR + 5, &nC, &sFldNotes);

   Evaluate &nFldType
   When 0
   When 1
      &ssObj.SetCellString(&nR + 1, &nC, "Character");
      &ssObj.SetCellString(&nR + 2, &nC, getFieldFormatText(&nFldType, &nFldFmt));
      &ssObj.SetCellString(&nR + 4, &nC, &FldDefault);
      Break;
   When 2
   When 3
      &ssObj.SetCellString(&nR + 1, &nC, "Number");
      &ssObj.SetCellNumber(&nR + 2, &nC, 0, "0,00");
      &ssObj.SetCellNumber(&nR + 4, &nC, Value(&FldDefault), "0.00");
      Break;
   When 4
      &ssObj.SetCellString(&nR + 1, &nC, "Date");
      &ssObj.SetCellString(&nR + 2, &nC, &sFldDF | " by " | &sFldDtSep);
      &ssObj.SetCellDate(&nR + 4, &nC, &FldDefault, "EN", "UTC", &sFldDF);
      Break;
   When 5
      &ssObj.SetCellString(&nR + 1, &nC, "Time");
      &ssObj.SetCellString(&nR + 2, &nC, getFieldFormatText(&nFldType, &nFldFmt));
      &ssObj.SetCellDate(&nR + 4, &nC, &FldDefault, "EN", "UTC", "hh:mm:ss AM/PM");
      Break;
   When 6
      &ssObj.SetCellString(&nR + 1, &nC, "DateTime");
      &ssObj.SetCellString(&nR + 2, &nC, &sFldDF | " by " | &sFldDtSep | " " | getFieldFormatText(&nFldType, &nFldFmt));
      &ssObj.SetCellDate(&nR + 4, &nC, &FldDefault, "EN", "UTC", &sFldDF | "Thh:mm:ss AM/PM");
      Break;
   When 8
   When 9
      &ssObj.SetCellString(&nR + 1, &nC, "Image Type (NotSupported)");
      Break;
   When-Other
      &ssObj.SetCellString(&nR + 1, &nC, "Type Not Supported");
      Break;
   End-Evaluate;
End-Function;

