Declare Function add_attachment PeopleCode FILE_ATTACH_WRK.ATTACHADD FieldChange;

&URL_ID = "URL.ZZ_BC_LD_FILE_URL";
&FILEEXTENSION = "*.*";
&PREPEND = False;
&RECNAME = "RECORD.ZZ_BC_LD_FILE";
&ATTACHSYSFILENAME = Substitute(Substitute(RTrim(String(%Datetime), "0"), "-", ""), ".", "") | "_";
&SUBDIRECTORY = "";
&ATTACHUSERFILE = "";
&MESSAGE_LVL = 2;
rem MessageBox(0, "", 0, 0, "&ATTACHSYSFILENAME: " | &ATTACHSYSFILENAME);
SQLExec("DELETE FROM PS_ZZ_BC_LD_FILE WHERE 1=1");
CommitWork();

add_attachment(&URL_ID, &FILEEXTENSION, &SUBDIRECTORY, 0, &PREPEND, &RECNAME, &ATTACHSYSFILENAME, &ATTACHUSERFILE, &MESSAGE_LVL, &RETCODE);

If &RETCODE = 0 Then
   Record.ZZ_CMN_LD_RC.ATTACHMENTNAME.Value = &ATTACHSYSFILENAME;
   Record.ZZ_CMN_LD_RC.ATTACHUSERFILE.Value = &ATTACHUSERFILE;
End-If;

